Glee is een Amerikaanse, komische en muzikale televisieserie van
de zender FOX. De serie ging in premiere op 19 mei 2009.

[img]http://imagizer.imageshack.com/img537/4272/UL8lxR.png[/img]

Het verhaal in Glee draait om een groep jongeren die, onder leiding van
hun leerkracht, een koor beginnen op hun school. Dit is de fictieve
William McKinley High School in Lima (Ohio). Centraal staan de gebreken
van elk van hen en hoe ze moeten opboksen tegen de vooroordelen van hun
medestudenten en enkele leerkrachten.
